import React, { useState } from "react";

function App() {
  const style = {
    heigth: "1080px",
    padding: "100px",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    gap: "12px",
  };

  const liStyle = {
    width: "100px",
    height: "100px",
    border: "1px solid green",
    borderRadius: "10px",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
  };
  return (
    <div>
      <ul style={style}>
        <li style={liStyle}>감자</li>
        <li style={liStyle}>감자</li>
        <li style={liStyle}>감자</li>
        <li style={liStyle}>감자</li>
        <li style={liStyle}>감자</li>
      </ul>
    </div>
  );
}

export default App;
